import {createSlice} from '@reduxjs/toolkit';

const navSlice = createSlice({
    name: 'nav',
    initialState: {
        currentPage: 'home',

    },
    reducers: {
            CHANGE_PAGE: (state, action) => {
            state.currentPage = action.payload;
        },
    }
});

export const {CHANGE_PAGE} = navSlice.actions;
export default navSlice.reducer;
